import React, { useEffect, useState } from 'react';
import "animate.css";
import "./main.css";

const Main = () => {
  const [animateClass, setAnimateClass] = useState('');

  useEffect(() => {
    // إضافة فئة الانميشن بعد تحميل المكون
    setAnimateClass('animate__backInDown');
  }, []);

  return (
    <main className="main-class"> 
      <div className='flex'>
        <div >
          <img src="/assets/images/Group-12.png" alt="" width={250} height={200} className={animateClass} />
        </div>
      </div>
    </main>
  );
}

export default Main;
